package ccc.mainComponent.UI;

import java.awt.EventQueue;
import java.awt.Image;
import java.awt.Window;

import javax.swing.ImageIcon;
import javax.swing.JFrame;
import javax.swing.JLabel;

import ccc.interaction.global.autoNotificationPusher;
import ccc.interaction.global.popUpBox;
import ccc.interaction.internalFeatures.Base64EncoderStatic;
import ccc.mainComponent.UIComponents.cwuLoginHelper;

import java.awt.Color;
import javax.swing.JTextField;
import javax.swing.SwingWorker;
import javax.swing.JButton;
import java.awt.event.ActionListener;
import java.awt.event.ActionEvent;
import java.awt.event.MouseAdapter;
import java.awt.event.MouseEvent;
import java.awt.event.KeyAdapter;
import java.awt.event.KeyEvent;
import javax.swing.JPasswordField;

public class CWUSplashScreen {

	private JFrame frame;
	private String cwuMain = "";
	private JTextField usernameLogin;
	private JTextField passwordField;

	private boolean userClicked = false;
	private boolean passClicked = false;
	static CWUSplashScreen window;
	private JPasswordField passwordField_1;
	/**
	 * Launch the application.
	 */
	public static void main() {
		EventQueue.invokeLater(new Runnable() {
			public void run() {
				try {
					window = new CWUSplashScreen();
					window.frame.setVisible(true);
				} catch (Exception e) {
					e.printStackTrace();
				}
			}
		});
	}

	/**
	 * Create the application.
	 */
	public CWUSplashScreen() {
		initialize();
	}

	/**
	 * Initialize the contents of the frame.
	 */
	private void initialize() {
		frame = new JFrame();
		frame.setBackground(Color.BLACK);
		frame.setBounds(100, 100, 800, 450);
		frame.setDefaultCloseOperation(JFrame.DISPOSE_ON_CLOSE);
		frame.getContentPane().setLayout(null);
		
		JButton loginButton = new JButton("");
		loginButton.addActionListener(new ActionListener() {
			public void actionPerformed(ActionEvent e) {
			}
		});
		loginButton.setBounds(182, 22, 420, 290);
		loginButton.setOpaque(false);
		loginButton.setContentAreaFilled(false);
		loginButton.setBorderPainted(false);
		frame.getContentPane().add(loginButton);
		
		usernameLogin = new JTextField();
		usernameLogin.addKeyListener(new KeyAdapter() {
			@Override
			public void keyReleased(KeyEvent e) {
				if(e.getKeyCode() == KeyEvent.VK_ENTER) {
					passwordField.requestFocus();
					passwordField.setText("");
				}
			}
		});
		usernameLogin.setText("Username or CWU ID");
		usernameLogin.addMouseListener(new MouseAdapter() {
			@Override
			public void mouseClicked(MouseEvent e) {
				resetUser();
			}

			private void resetUser() {
				if(userClicked == false) {
					userClicked = true;
					usernameLogin.setText("");
				}
				
			}
		});
		usernameLogin.setToolTipText("Username");
		usernameLogin.setBounds(263, 323, 261, 20);
		frame.getContentPane().add(usernameLogin);
		usernameLogin.setColumns(10);
		
		passwordField = new JPasswordField();
		passwordField.addKeyListener(new KeyAdapter() {
			@Override
			public void keyReleased(KeyEvent e) {
				if(e.getKeyCode() == KeyEvent.VK_ENTER) {
		        	  
					loginPerform(usernameLogin.getText(),passwordField.getText());
				}
			}
				
		});
		passwordField.addMouseListener(new MouseAdapter() {
			@Override
			public void mouseClicked(MouseEvent e) {
				resetPass();
			}

			private void resetPass() {
				if(passClicked == false) {
					passClicked = true;
					passwordField.setText("");
				}
				
			}
		});
		passwordField.setText("Password");
		passwordField.setToolTipText("Password");
		passwordField.setColumns(10);
		passwordField.setBounds(263, 354, 261, 20);
		frame.getContentPane().add(passwordField);
		
		JLabel CWUBackground = new JLabel();
		CWUBackground.setBounds(0, 0, 785, 411);
		frame.getContentPane().add(CWUBackground);
		Image cwuBG = Base64EncoderStatic.DecryptPicture(cwuMain);
		cwuBG = cwuBG.getScaledInstance(CWUBackground.getWidth(), CWUBackground.getHeight(), Image.SCALE_SMOOTH);
		ImageIcon CWUBGMAIN = new ImageIcon(cwuBG);
		CWUBackground.setIcon(CWUBGMAIN);
		
		
	}

	protected void loginPerform(String user, String pass) {
		 SwingWorker<Void, Void> submitter = new SwingWorker<Void, Void>()
         {
          protected Void doInBackground() throws Exception
          {
        	 // popUpBox.infoBox("Please wait, the page is loading...\nPlease ignore the movement of your mouse and keyboard for a moment.\nTip : Stay still until the page finished download to prevent error.\nPress okay to continue.",this.getClass(), "CWU Login Panel");
      			autoNotificationPusher.notPush("INFO", "", "Please wait, the page is loading...\nPlease ignore the movement of your mouse and keyboard for a moment.(Around 3-5 seconds.)\nTip : Stay still until the page finished download to prevent error.\nPress okay to continue.", Class.class, "AUTO");
        	  cwuLoginHelper.login(user, pass);
           return null;
          }
         };     
        submitter.execute();
	}
}
